-- Contains keychain settings.	 version An unsigned 32-bit integer representing the keychain version.	 lockOnSleep A boolean value indicating whether the keychain locks when the system sleeps.	 useLockInterval A boolean value indicating whether the keychain automatically locks after a certain period of time.	 lockInterval An unsigned 32-bit integer representing the number of seconds before the keychain locks.
data SecKeychainSettings = SecKeychainSettings
  { secKeychainSettingsVersion :: !CUInt
  , secKeychainSettingsLockOnSleep :: !CUChar
  , secKeychainSettingsUseLockInterval :: !CUChar
  , secKeychainSettingsLockInterval :: !CUInt
  } deriving (Eq, Show)

instance Storable SecKeychainSettings where
  sizeOf    _ = 12
  alignment _ = 4
  peek p = SecKeychainSettings <$> peekByteOff p 0
    <*> peekByteOff p 4
    <*> peekByteOff p 5
    <*> peekByteOff p 8
  poke p (SecKeychainSettings {..}) = do
    pokeByteOff p 0 secKeychainSettingsVersion
    pokeByteOff p 4 secKeychainSettingsLockOnSleep
    pokeByteOff p 5 secKeychainSettingsUseLockInterval
    pokeByteOff p 8 secKeychainSettingsLockInterval

