secKeychainSettingsStructType :: Ptr CType
secKeychainSettingsStructType = unsafePerformIO $ fst <$> newStructCType [ffi_type_uint, ffi_type_uint8, ffi_type_uint8, ffi_type_uint]

argSecKeychainSettings :: SecKeychainSettings -> Arg
